window.bookSummaryJSON = "<p><b>Born without a scent. A beta meant to serve forever.</b></p> <p><b>Breanna</b></p> <p>My parents despised me since the day I was born, expecting an omega with a lovely scent and a claw birthmark.</p> <p>But I was born with neither.</p> <p>Betas are meant to be the servants of the Alpha Compound run by our pack leader, Henry.</p> <p>Injured by my father—I ran away, never expecting to see another alpha ever again until…</p> <p><b>Zaff</b></p> <p>My pack needs an omega, but we had given that up years ago until I stumbled across a cleaning ad and a beautiful face to match.</p> <p>She's a breath of fresh air when she enters my mansion, but we're all drawn to her.</p> <p>She's not an omega. She has no scent.</p> <p>Yet we're still drawn to her for some mysterious reason.</p> <p>My pack and I just cannot keep our hands off her. Until we discover what she truly is…</p> <p>Maid for The Alphas <i>is a continuation spinoff series of Howl's Edge Island: Omega for The Pack Series. This book can be listened to as a standalone with a guaranteed HEA. Includes overprotective billionaire growly alphas, omega heat, and all the steamy knottings.</i></p>"; 
